import express from 'express';
import data from './store';
import cors from 'cors';

const app = express(); // instanciranje aplikacije
const port = 3200; // port na kojem će web server slušati

app.use(cors());
app.use(express.json());


// korisnik:
app.get('/korisnici', (req, res) => res.json(data.korisnici)); // working
app.get('/korisnici/:id'/* ili '/korisnici/:oib'*/ , (req, res) => res.json(data.jedan_korisnik)); // working
app.post('/korisnici', (req, res) => {
    res.statusCode = 201;
    res.setHeader('Location', '/korisnici/1234'); // working i think
    res.send();
});

// vozilo:
app.get('/vozilo', (req, res) => res.json(data.vozilo)); // working
app.get('/vozilo/:sasija', (req, res) => res.json(data.jedno_vozilo)); // working

// UNOS NOVOG VOZILA -> POGLEDAT DOLJE (MISLIM DA JE OVO PRAVI NAČIN!!!)
app.post('/vozilo', (req, res) => {
    res.statusCode = 201;
    res.setHeader('Location', '/vozilo/1234'); // working i think
    res.send();
});

// UNOS NOVOG VOZILA -> PROVJERIT SA KODOM IZNAD (POST ILI PUT)
/*app.put('/vozilo/:šasija/.../.../.../.../...', (req, res) => {
    let data = req.body;
    if (!data.ocjena) {
        res.statusCode = 400;
        return res.json({
            error: 'There are parameters missing.',
        });
    }
    res.statusCode = 201;
    res.setHeader('Location', '/kolegiji/wapps/ispiti/01-05-2020/rezultati/student/003512341234');
    res.send();
});*/

// povezivanje vozila i korisnika -> unos informacija korisnika za određeno vozilo (if (data.najamVozila = false)...)

app.get('/vozilo/:sasija/korisnik/:id', (req, res) => res.json(data.najamVozila))
app.put('/vozilo/:sasija/korisnik/:id', (req, res) => {
    let data = req.body;
    if (!data.najam /* && data.najam == false*/) {
        res.statusCode = 400;
        return res.json({
            error: 'There are parameters missing.',
        });
    }
    res.statusCode = 201;
    res.setHeader('Location', '/vozilo/ABD1234585/korisnik/123123123'/*/.../.../...*/); // working
    res.send();
});

// SVI UGOVORI ILI NAJAMI ILI NALOZI:

app.get('/ugovori', (req, res) => res.json(data.ugovori));
app.get('/ugovori/:id', (req, res) => res.json(data.jedan_ugovor));

// STVARANJE NOVOG UGOVORA:

app.post('/ugovori', (req, res) => {
    res.statusCode = 201;
    res.setHeader('Location', '/ugovor/1'); // working i think
    res.send();
});



// OPTIONAL ZASADA: način plaćanja -> kreditna kartica, gotovina


app.listen(port, () => console.log(`Slušam na portu ${port}!`));



/*

// studenti
app.get('/studenti', (req, res) => res.json(data.studenti));
app.get('/studenti/:jmbag', (req, res) => res.json(data.jedan_student));
app.post('/studenti', (req, res) => {
    res.statusCode = 201;
    res.setHeader('Location', '/studenti/1234');
    res.send();
});

// kolegiji
app.get('/kolegiji', (req, res) => res.json(data.kolegiji));

// ispiti
app.get('/kolegiji/:kolegij/ispiti/:datum/rezultati', (req, res) => res.json(data.pretragaIspita));
app.get('/kolegiji/:kolegij/ispiti/:datum/rezultati/student/:jmbag', (req, res) => res.json(data.ocjenaStudenta));

// unos jedne ocjene
app.put('/kolegiji/:kolegij/ispiti/:datum/rezultati/student/:jmbag', (req, res) => {
    let data = req.body;

    if (!data.ocjena) {
        res.statusCode = 400;
        return res.json({
            error: 'There are parameters missing.',
        });
    }

    res.statusCode = 201;
    res.setHeader('Location', '/kolegiji/wapps/ispiti/01-05-2020/rezultati/student/003512341234');
    res.send();
});

app.listen(port, () => console.log(`Slušam na portu ${port}!`));

