        let db = await connect()
        let user = await db.collection('rentDuration').findOne({ pocetak_iznajmljivanja: pocetak_iznajmljivanja, lokacija_prihvata: lokacija_prihvata, kraj_iznajmljivanja: kraj_iznajmljivanja })
        
